import React, { Component } from 'react';

class TextInput extends Component {

  constructor(props) {
    super(props)
    this.state = {
      state: 'A'
    }
  }

  render() {
    return (
      <input placeholder={this.props.placeHolder(this.state.state)}></input>
    )
  }
}

export default TextInput;

